import { BrowserRouter as Router } from "react-router-dom";
import "./App.css";
import Footer from "./components/layout/Footer";
import Header from "./components/layout/Header";
import Home from "./components/Home";

function App() {
  return (
    <Router>
      <div className="App">
        <Header />

        <div class="container">
          <Home />
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
